(1902, 348, 7, 14, 'Quando sairam as inscrições fiz as matrículas destas sendo concreto armado l e projeto de obras civis l, mas não fiz a de saneamento por causa do sistema que não disponibilizou a disciplina para eu me matricular, enviei e-mail para a coordenadora dor curso de eng. civil em dezembro de 2020 a respeito de ter passada nas matérias de hidráulica e teoria ll que são pré requisito para saneamento e concreto l, não consegui me matricular em saneamento somente em concreto l no sétimo período. Por causa de saneamento vou atrasar um ano sendo que eu poderia fazer ela uma vez que o erro não foi meu, pois não aparecia no sistema para me matricular, já conversei com Ana Paula e nada se resolveu, com Alessandro e também não conseguiu solucionar, com Wallace também que ficou me enrrolando por uma semana e nada resolveu. Fora uma covardia sendo que não tive culpa, porque não tive a opção de me matricular em saneamento por causa do pré-requisito de hidráulica. A disciplina iniciou faz pouco tempo por isso preciso de uma resposta o quanto antes. Hoje 25/ 02/ 2021 neste momento às 17: 00 está havendo aula de saneamento com o professor Jonathan, mas não consigo participar por não estar matriculado na matéria, uma plena covardia fizeram, e eu muito querendo estar participando.', 'Finalizado', '2021-02-25 17:04:55', '2021-02-26', '2021-02-26 19:15:00', 0, 0, NULL, NULL, 1, 1, '2021-02-25 17:45:36', 901),
