(2013, 1073, 5, 11, 'Solicitação: Trancamento de Matrícula Bacharelado em Administração.\r\n\r\nJustificativa: Em agosto descobri que após 15 anos que tive da minha primeira filha, estava grávida novente. Sei que gravidez não é doença, mas foi um início muito conturbado. Passei muito mal e descobri além, que minha gestação é gêmelar. Mesmo sem ter nenhum caso de gemelares na família atualmente ou em gerações passadas. Fui duplamente abençoada e ao mesmo tempo,  um dos motivos pela qual passei muito mal, o excesso de hormônios e transformação do organismo inicialmente. Precisei ficar todo o primeiro trimestre gestacional de repouso absoluto devido 3 ameaças de aborto. \r\nDepois disso, melhorei um pouco, mas a gestação continuou expirando muitos cuidados.  \r\nÉ uma gestação classificada   pelo SUS como sendo de  alto risco  (idade, com excesso de peso e  gestação gêmelar) e também o medo da Pandemia. Tanto que faço acompanhamento no CEM (Centro de Especialidades Médicas) aqui em Pirapora.\r\n\r\nEu precisei parar como minhas atividades laborais. Hoje estou bem melhor do que no início, porém passei a toda a gravidez com \" monstros\" assolando minha cabeça. Tive que me manter centrada e forte para combater a todo instante vários medos. O que me atrapalhou a voltar a mente para  outras questões que não fossem minha saúde e a dos meus bebês (João e Pedro) que estão prestes a chegar.\r\n\r\nSolicito, encarecidamente, o trancamento da matrícula para que eu não perca todo curso na qual me dediquei e nunca tive nenhuma dependência. \r\nCerta de contar com vossa sensibilidade nesse momento difícil e ao mesmo tempo de graça e bênção, peço encarecidamente, pela última vez, o trancamento da minha matrícula.', 'Finalizado', '2021-03-09 08:23:40', '2021-03-12', '2021-03-12 20:36:14', 0, 0, NULL, NULL, 0, 1, '2021-03-10 14:21:47', 901),
(2014, 1201, 5, 14, 'Trancamento de matrícula', 'Finalizado', '2021-03-09 09:11:53', '2021-03-12', '2021-03-12 20:57:04', 0, 0, NULL, NULL, 1, -1, '2021-03-10 14:23:17', 901),
