(3251, 932, 11, 2, 'Preciso de uma declaração que comunique o erro ocorrido em uma outra declaração que me enviaram, dizendo que o prazo para emissão de alguns documentos começava a ser contado a partir da conclusão do curso quando na verdade era do momento de solicitação. Nessa declaração deve constar a justificativa dos motivos do não atendimento à solicitação e informando os reais prazos de emissão dos documentos necessários, sendo eles o histórico escolar e o diploma. Já realizei esse pedido atrás do email onde consido anexar mais algumas informações, como a declaração que me foi enviada pelo IF e o ofício de pendência da universidade, no entanto ainda não obtive resposta, como estou necessitando dessa declaração com urgência decidi fazer o requerimento por aqui já que o prazo para entrega do documento é até amanhã, dia 04/05/2021.', 'Entregue', '2021-05-03 17:19:29', '2021-06-03', '2021-05-10 13:18:15', 0, 0, NULL, NULL, 1, 1, '2021-05-03 17:57:39', 899),
