(6658, 1854, 7, 14, 'Ao Senhor:\r\nWallace Magalhães Trindade\r\nDiretor do Instituto Federal do Norte de Minas Gerais - Campus Pirapora- MG.\r\n\r\nAssunto: Climatização no Laboratório V\r\n\r\nPrezado Senhor,\r\nO presente ofício tem por finalidade informar que desde o retorno das aulas presenciais no dia 17 deste mês, notou-se uma deficiência no ar condicionado do Laboratório V do IFNMG – Campus Pirapora- MG.\r\nEu, Gleiciane Barrence da Silva, estudante do curso de Bacharelado em Engenharia Civil venho requerer uma solução para o problema supracitado tendo em vista que o clima quente da cidade ocasiona em ambiente fechado, como o da sala de aula, um desconforto térmico geral mas, principalmente para o 3º período, turma em que estou matriculada e a mesma possui dois horários seguidos de Desenho Arquitetônico. Como os computadores ficam ligados para o uso dos alunos durante esse período e mesmo após para os alunos que precisam de dar continuidade aos seus projetos, por não possuírem máquinas específicas com capacidade para funcionamento dos softwares utilizados na disciplina, ressalto também a importância do funcionamento adequado do ar condicionado para preservação destes computadores.\r\nCerta da compreensão, aguardo retorno.\r\n\r\nGleiciane Barrence da Silva\r\nMatrícula: 178895\r\n\r\nPirapora, 30 de março de 2022', 'Finalizado', '2022-03-30 08:35:48', '2022-03-30', '2022-03-30 17:02:01', 0, 0, NULL, NULL, 1, 0, NULL, NULL),
(6659, 2802, 21, 2, 'Me formei no IFNMG - Campus Pirapora em 2018 e agora preciso do historico escolar para dar prosseguimento na documentação da faculdade na qual estou ingressando.', 'Finalizado', '2022-03-30 09:46:39', '2022-05-13', '2022-03-30 15:27:43', 0, 0, NULL, NULL, 1, 0, NULL, NULL),
(6660, 1854, 7, 14, 'Ao Senhor:\r\nWallace Magalhães Trindade\r\nDiretor do Instituto Federal do Norte de Minas Gerais - Campus Pirapora- MG.\r\n\r\nAssunto: Climatização no Laboratório V\r\n\r\nPrezado Senhor,\r\nO presente ofício tem por finalidade especificar a solução para a deficiência no ar condicionado do Laboratório V do IFNMG – Campus Pirapora- MG.\r\nO Terceiro período do Curso de Bacharelado em Engenharia Civil, tecnicamente propõe melhoria do ambiente, tendo em vista o tamanho da sala, a quantidade de computadores existentes e ainda o tempo em que os mesmos ficam em funcionamento. O ar condicionado já instalado na sala está com defeito. Mesmo sendo programada a manutenção corretiva do mesmo, o problema persistiria pois  sua capacidade é insuficiente para climatizar a sala sendo o mais adequado a instalação de dois aparelhos de 24.000 btu’s a fim de promover o conforto para todos os alunos e a preservação dos equipamentos.\r\nCientes da vossa compreensão, aguardamos retorno e desde já agradecemos.\r\n\r\n3º Período Eng. Civil\r\nIFNMG – Campus Pirapora\r\n\r\nPirapora, 30 de março de 2022', 'Finalizado', '2022-03-30 10:09:03', '2022-03-30', '2022-03-30 17:02:17', 0, 0, NULL, NULL, 1, 0, NULL, NULL),
(6661, 1615, 11, 7, 'Declaração de matrícula', 'Entregue', '2022-03-30 10:30:45', '2022-04-04', '2022-03-31 09:32:11', 0, 0, NULL, NULL, 0, 0, NULL, NULL),
