(7023, 716, 5, 14, 'Falta por atestado. \r\nFaltarei os próximos 6 dias de aula (contando com hoje) devido ao Covid-19. Fiz o teste hoje, mas a unidade de saúde está com ausência de médico. Segue então, declaração feita por enfermeira decorrente de hoje (24/06). Na segunda-feira, assim que passar pelo médico, irei anexar o atestado assinado, justificando a ausência entre os dias 27/06 até o dia 01/07.', 'Finalizado', '2022-06-24 19:31:55', '2022-06-27', '2022-06-29 19:15:38', 0, 0, NULL, NULL, 1, 1, '2022-06-27 08:52:23', 899),
