(7025, 716, 5, 14, 'Requerimento de presença. \r\n\r\nPeço por gentileza que verifiquem minhas presenças lançadas no Cajui. \r\nEstou tendo diversos problemas em decorrência a ela, e devido a essa falha, corro o risco de reprovar por falta. Como visto, a minha matrícula foi deferida na webpir no dia 31/03 (quinta-feira), no print indicado, recebi uma informação por uma servidora do campus que eu já poderia iniciar a presença nas aulas. Independente de poder ou não, eu recebi essa informação, nesse mesmo print, é indicada a data 01/04 (sexta-feira) porém eu iniciei as idas ao Instituto na segunda-feira (04/04) porém o meu nome foi constar no sistema a partir do dia 18/04 e ainda sim, com inúmeras falhas. Não faltei nenhum dia nesse período, porém não consigo resolver com nenhum servidor. Peço que analisem o meu caso e me dêem um retorno o mais breve possível. \r\nAntes de qualquer coisa, já conversei com todos os meus professores e infelizmente eles não conseguem fazer essa alteração, porque novamente o sistema os deixam limitados e as minhas faltas permanecem.', 'Finalizado', '2022-06-24 19:50:37', '2022-06-28', '2022-06-28 15:36:15', 0, 0, NULL, NULL, 1, 1, '2022-06-27 08:52:21', 899),
